import logo from "./logo.svg";
import "./App.css";
import Data from "./Data";

function App() {
  return (
    <main>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Data />
        </header>
      </div>
    </main>
  );
}

export default App;
